import React, { useState } from 'react';
import { ChromePicker } from 'react-color';
import './TriangleColorPickerComponent.css';
const TriangleColorPickerComponent = ({
  isVisible,
  triangleColor,
  setTriangleColor,
  triangleStrokeColor,
  setTriangleStrokeColor,
}) => {
  return (
    isVisible && (
      <div>
        <ChromePicker color={triangleColor}setTriangleColor onChange={(updateColor) => setTriangleColor(updateColor.hex)} />
      </div>
    )
  );
};

export default TriangleColorPickerComponent;
